import React from "react";
//import { Link  } from 'react-router-dom';
import { NavLink } from "react-router-dom";

function Header() {
  return (
    <header className="navbar navbar-expand-lg navbar-light bg-light">
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNavDropdown">
        <ul className="navbar-nav">
          <li className="nav-item active">
            <NavLink className="nav-link" to="/PharmacieForm" activeClassName="active">Home <span className="sr-only">(current)</span></NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" to="/PharmacieForm" activeClassName="active">Features</NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" to="/PharmacieForm" activeClassName="active">Pricing</NavLink>
          </li>
          <li className="nav-item dropdown">
            <NavLink activeClassName="active" className="nav-link dropdown-toggle" to="/PharmacieForm"  id="navbarDropdownMenuLink" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
              Dropdown link
            </NavLink>
            <div  className="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
              <NavLink activeClassName="active" className="dropdown-item" to="/PharmacieForm" >Action</NavLink>
              <NavLink activeClassName="active" className="dropdown-item" to="/PharmacieForm" >Another action</NavLink>
              <NavLink activeClassName="active" className="dropdown-item" to="/PharmacieForm" >Something else here</NavLink>
            </div>
          </li>
        </ul>
      </div>
    </nav>
  </header>
  );
}

const Footer = () => {
  return (
    <footer className="bg-light text-center text-lg-start">
      <p className="text-center p-3"> Â© {new Date().getFullYear()} Mon application</p>
    </footer>
  );
};

export { Header, Footer };
